import React from 'react';
import ReactDOM from 'react-dom';
import ReactHlsPlayer from 'react-hls-player';


const Map = () => {
    return (
        <div style={{ color: 'black'}}>
          <ReactHlsPlayer
    src="https://www.youtube.com/watch?v=kknVfOJZ1w0"//"rtmp://127.0.0.1/live/test"
    autoPlay={true}
    controls={true}
    width="100%"
    height="auto"
  />

        </div>
    )
}

export default Map
